e statistic and compare to the decision point value of corresponding to a degree of freedom of 1 which is 3.84.  Since 𝜒% is larger than DP, then we have enough statistical evidence to reject the 𝐻; and conclude that X and Y are not significantly independent to each other among all subjects in the population.\n","\n","In simpler terms, this chi-square test suggests that the likelihood of being self-made differs significantly between genders. The data provides strong evidence that these two variables are associated, and they are not independent of each other in the population."]},{"cell_type":"markdown","id":"7a639b15","metadata":{"papermill":{"duration":0.025044,"end_time":"2023-11-13T20:17:16.948026","exception":false,"start_time":"2023-11-13T20:17:16.922982","status":"completed"},"tags":[]},"source":[]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":3795419,"sourceId":6570253,"sourceType":"datasetVersion"},{"datasetId":3868585,"sourceId":6713241,"sourceType":"datasetVersion"}],"dockerImageVersionId":30530,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":9.625429,"end_time":"2023-11-13T20:17:17.097035","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-11-13T20:17:07.471606","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}